import React from 'react';
import '../../App.css';
import AboutSection from '../AboutSection';
import HeroSection from '../HeroSection';
import Footer from '../Footer';

function Home() {
  return (
    <>
      <HeroSection />
      <AboutSection />
      <Footer />
    </>
  );
}

export default Home;
